import React from "react";
import "./Footerbar.scss";

function Footerbar() {
  return (
    <>
      <section>
        <div className="d-flex">
          <ul>
            <li>Terms</li>
            <li>Privacy Policy</li>
          </ul>
          <p>Copyright 2022 | All Rights Reserved.</p>
        </div>
      </section>
    </>
  );
}

export default Footerbar;
